import React from "react";
import Layout from "../../../Common/Component/Layout";
import "./index.scss";

export default function View(props) {
  const resultImg =
    "https://d1tz4sj00zmgsb.cloudfront.net/events/%EB%A7%A4%EC%A7%81%EC%8A%A4%ED%8E%A0/magicspell_result.jpg";

  return (
    <Layout>
      <div className="eventEnd0">
        <img className="eventEnd0_resultImg" src={resultImg} alt={"result"} />
      </div>
    </Layout>
  );
}
